import React from "react";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";

const LoginForm = () => {
  console.log("lsfdk");
  return (
    <div>
      <form noValidate autoComplete="off">
        <div>
          <TextField id="standard-basic" label="Login" name="login" />
        </div>
        <div>
          <TextField
            id="standard-basic"
            type="password"
            label="Password"
            name="password"
          />
        </div>
        <div>
          <Button variant="contained" color="primary">
            Signin
          </Button>
        </div>
        <div>
          <p>Signup</p>
        </div>
      </form>
    </div>
  );
};

export default LoginForm;
